import * as React from 'react';
import { StyledMenu } from './menu.styled';
import Logo from '../logo';
import MenuLink from '../menuLinks';

const Menu = ({ open }) => {
  return (
    <StyledMenu open={open}>
      <Logo></Logo>
      <ul>
        <MenuLink />
      </ul>
    </StyledMenu>
  );
};
export default Menu;
